// SPDX-License-Identifier: MIT
pragma solidity ^0.8.1;

// Import the interface
import "./interfaces/ITeleporterMessenger.sol";

contract AvalancheAssetLink {
    address public teleporter; // Address of the TeleporterMessenger contract
    address public owner;

    // Events for cross-chain messaging
    event MessageSent(
        bytes32 destinationChainID,
        address indexed destinationAddress,
        bytes message
    );

    event MessageReceived(
        bytes32 sourceChainID,
        address indexed sender,
        bytes message
    );

    // Modifier for owner-only access
    modifier onlyOwner() {
        require(msg.sender == owner, "Not authorized");
        _;
    }

    // Constructor to initialize the teleporter contract
    constructor(address _teleporter) {
        require(_teleporter != address(0), "Teleporter address cannot be zero");
        teleporter = _teleporter;
        owner = msg.sender;
    }

    // Function to send cross-chain messages
    function sendMessage(
        bytes32 destinationChainID,
        address destinationAddress,
        uint256 gasLimit,
        bytes memory payload
    ) external payable onlyOwner {
        // Prepare fee information
        TeleporterFeeInfo memory feeInfo = TeleporterFeeInfo({
            feeTokenAddress: address(0), // Fee token address (use actual address if applicable)
            amount: msg.value           // Fee paid in native currency
        });

        // Prepare the message input
        TeleporterMessageInput memory messageInput = TeleporterMessageInput({
            destinationBlockchainID: destinationChainID,
            destinationAddress: destinationAddress,
            feeInfo: feeInfo,
            requiredGasLimit: gasLimit,
            allowedRelayerAddresses: new address[](0), // Correct initialization of empty array
            message: payload
        });

        // Call the TeleporterMessenger contract to send the message
        ITeleporterMessenger(teleporter).sendCrossChainMessage(messageInput);

        emit MessageSent(destinationChainID, destinationAddress, payload);
    }

    // Function to handle incoming messages (implements ITeleporterReceiver)
    function receiveTeleporterMessage(
        bytes32 sourceChainID,
        address sender,
        bytes calldata message
    ) external {
        require(msg.sender == teleporter, "Unauthorized sender");

        // Emit event for received messages
        emit MessageReceived(sourceChainID, sender, message);
    }

    // Function to update the TeleporterMessenger contract address
    function updateTeleporter(address _newTeleporter) external onlyOwner {
        require(_newTeleporter != address(0), "New teleporter address cannot be zero");
        teleporter = _newTeleporter;
    }
}

contracts/FeeCollector.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.1;

import "./SecurityLayer.sol";

contract FeeCollector {
    address public owner;
    mapping(uint256 => uint256) public feesCollected;
    mapping(address => bool) public gasSponsors;
    SecurityLayer public securityLayer;

    event Fees_Collected(uint256 tokenId, uint256 amount);
    event Sponsor_Added(address sponsor);
    event Sponsor_Removed(address sponsor);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not the owner");
        _;
    }

    constructor() {
        owner = msg.sender;
        securityLayer = new SecurityLayer();  // Create an instance of SecurityLayer
    }

    function collectFees(uint256 tokenId, uint256 amount) external onlyOwner {
        require(securityLayer.validateData(abi.encodePacked(tokenId, amount)), "Invalid data");
        feesCollected[tokenId] += amount;

        emit Fees_Collected(tokenId, amount);
    }

    function addGasSponsor(address sponsor) external onlyOwner {
        gasSponsors[sponsor] = true;

        emit Sponsor_Added(sponsor);
    }

    function removeGasSponsor(address sponsor) external onlyOwner {
        gasSponsors[sponsor] = false;

        emit Sponsor_Removed(sponsor);
    }
}

contracts/interfaces/ITeleporterMessenge.content:
// SPDX-License-Identifier: Ecosystem
pragma solidity ^0.8.1;

// Structs for cross-chain messaging
struct TeleporterFeeInfo {
    address feeTokenAddress;
    uint256 amount;
}

struct TeleporterMessageReceipt {
    uint256 receivedMessageNonce;
    address relayerRewardAddress;
}

struct TeleporterMessage {
    uint256 messageNonce;
    address originSenderAddress;
    bytes32 destinationBlockchainID;
    address destinationAddress;
    uint256 requiredGasLimit;
    address[] allowedRelayerAddresses;
    TeleporterMessageReceipt[] receipts;
    bytes message;
}

struct TeleporterMessageInput {
    bytes32 destinationBlockchainID;
    address destinationAddress;
    TeleporterFeeInfo feeInfo;
    uint256 requiredGasLimit;
    address[] allowedRelayerAddresses;
    bytes message;
}

// Interface for sending cross-chain messages
interface ITeleporterMessenger {
    // Events
    event BlockchainIDInitialized(bytes32 indexed blockchainID);
    event SendCrossChainMessage(
        bytes32 indexed messageID,
        bytes32 indexed destinationBlockchainID,
        TeleporterMessage message,
        TeleporterFeeInfo feeInfo
    );
    event AddFeeAmount(bytes32 indexed messageID, TeleporterFeeInfo updatedFeeInfo);
    event MessageExecutionFailed(
        bytes32 indexed messageID,
        bytes32 indexed sourceBlockchainID,
        TeleporterMessage message
    );
    event MessageExecuted(bytes32 indexed messageID, bytes32 indexed sourceBlockchainID);
    event ReceiveCrossChainMessage(
        bytes32 indexed messageID,
        bytes32 indexed sourceBlockchainID,
        address indexed deliverer,
        address rewardRedeemer,
        TeleporterMessage message
    );
    event ReceiptReceived(
        bytes32 indexed messageID,
        bytes32 indexed destinationBlockchainID,
        address indexed relayerRewardAddress,
        TeleporterFeeInfo feeInfo
    );
    event RelayerRewardsRedeemed(address indexed redeemer, address indexed asset, uint256 amount);

    // Functions
    function sendCrossChainMessage(TeleporterMessageInput calldata messageInput) external returns (bytes32);
    function retrySendCrossChainMessage(TeleporterMessage calldata message) external;
    function addFeeAmount(
        bytes32 messageID,
        address feeTokenAddress,
        uint256 additionalFeeAmount
    ) external;
    function receiveCrossChainMessage(
        uint32 messageIndex,
        address relayerRewardAddress
    ) external;
    function retryMessageExecution(
        bytes32 sourceBlockchainID,
        TeleporterMessage calldata message
    ) external;
    function redeemRelayerRewards(address feeTokenAddress) external;
    function getMessageHash(bytes32 messageID) external view returns (bytes32);
    function messageReceived(bytes32 messageID) external view returns (bool);
}

// Interface for receiving messages
interface ITeleporterReceiver {
    function receiveTeleporterMessage(
        bytes32 sourceBlockchainID,
        address originSenderAddress,
        bytes calldata message
    ) external;
}

contracts/RWA.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.1;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

contract RWA is ERC721, AccessControl {
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    bytes32 public constant UPDATER_ROLE = keccak256("UPDATER_ROLE");

    // Override supportsInterface to resolve the multiple inheritance conflict
    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC721, AccessControl) returns (bool) {
        return ERC721.supportsInterface(interfaceId) || AccessControl.supportsInterface(interfaceId);
    }

    uint256 public tokenIdCounter;
    mapping(uint256 => string) public metadataURIs;
    mapping(uint256 => address[]) public fractionalOwners;
    mapping(uint256 => mapping(address => uint16)) public ownershipShares; // Optimized to uint16

    event RWA_Minted(uint256 tokenId, address owner, string metadataURI);
    event Metadata_Updated(uint256 tokenId, string newMetadataURI, bytes32 metadataHash);
    event Fractional_Ownership_Set(uint256 tokenId, address[] owners, uint16[] shares);

    constructor() ERC721("RealWorldAsset", "RWA") {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(MINTER_ROLE, msg.sender);
        _setupRole(UPDATER_ROLE, msg.sender);
    }

    function mintRWA(address to, string memory metadataURI) external onlyRole(MINTER_ROLE) {
        uint256 newTokenId = tokenIdCounter++;
        _safeMint(to, newTokenId);
        metadataURIs[newTokenId] = metadataURI;

        emit RWA_Minted(newTokenId, to, metadataURI);
    }

    function updateMetadata(uint256 tokenId, string memory metadataURI, bytes32 metadataHash) 
        external 
        onlyRole(UPDATER_ROLE) 
    {
        require(_exists(tokenId), "Token does not exist");
        metadataURIs[tokenId] = metadataURI;

        emit Metadata_Updated(tokenId, metadataURI, metadataHash);
    }

    function setFractionalOwnership(uint256 tokenId, address[] memory owners, uint16[] memory shares) 
        external 
        onlyRole(MINTER_ROLE) 
    {
        require(owners.length == shares.length, "Mismatched inputs");
        uint256 totalShares = 0;
        for (uint256 i = 0; i < shares.length; i++) {
            totalShares += shares[i];
        }
        require(totalShares == 100, "Shares must sum to 100");

        fractionalOwners[tokenId] = owners;
        for (uint256 i = 0; i < owners.length; i++) {
            ownershipShares[tokenId][owners[i]] = shares[i];
        }

        emit Fractional_Ownership_Set(tokenId, owners, shares);
    }
}

